import React, {Component} from 'react';
import {Form} from "react-bootstrap";

class Dodawawie extends Component {
    render() {
        if(this.props.typ === "doks")
        return (
            <tr>
                <td></td>
                <td><Form.Control as="input" placeholder="Enter Id" name="id"/></td>
                <td><Form.Control as="input" placeholder="Enter Id" name="id"/></td>
                <td><Form.Control as="input" placeholder="Enter Id" name="id"/></td>
                <td><Form.Control as="input" placeholder="Enter Id" name="id"/></td>
                <td><Form.Control as="input" placeholder="Enter Id" name="id"/></td>

            </tr>

        );
        else if(this.props.typ === "tow")
            return (
                <div>
                    Dodawanie towaru
                </div>
            );
        else if(this.props.typ === "firms")
            return (
                <div>
                    Dodawanie firmy
                </div>
            );
        else if(this.props.typ === "mags")
            return (
                <div>
                    Dodawanie magazynu
                </div>
            );
        else if(this.props.typ === "dok")
            return (
                <div>
                    Dodawanie pozycji
                </div>
            );
    }
}

export default Dodawawie;
